import React from 'react';

import './error.sass';

const Error = ({ message }) => {

    return (
        <div className="error-message">
            <div>
                <a href={`/list/page${1}/?limit=10&skip=${0}`}>Back to main page</a>😞
            </div>
            {message
                ? <p>{message}</p>
                : <p>Sorry, something went wrong...</p>
            }
        </div>
    )
}



export default Error;
